import axios from "axios";

const EMPLOYEE_BASE_REST_API_URL = 'http://localhost:54369/';

class WorkoutService {

    getAllWorkouts() {
        return axios.get(EMPLOYEE_BASE_REST_API_URL);
    }
    createWorkout(workout) {
        return axios.post(EMPLOYEE_BASE_REST_API_URL, workout);
    }
    getWorkoutById(workoutId) {
        return axios.get(EMPLOYEE_BASE_REST_API_URL + '/' + workoutId)
    }
    updateWorkout(workoutId, workout) {
        return axios.put(EMPLOYEE_BASE_REST_API_URL + '/' + workoutId, workout);
    }
    deleteWorkout(workoutId) {
        return axios.delete(WORKOUT_BASE_REST_API_URL + '/' + workoutId);
    }
}

export default new WorkoutService();
